import logo from './logo.svg';
import './App.css';
import { Input, Layout, Menu,sea } from 'antd';
import { AudioOutlined } from '@ant-design/icons';


const { Header } = Layout;
const {Search} = Input;
const suffix = (
  <AudioOutlined
    style={{
      fontSize: 16,
      color: '#1890ff',
    }}
  />
);


function App() {
  return (
    <div className="App">
      <Header>
      <div className="logo" />
      <Menu theme="dark" mode="horizontal" defaultSelectedKeys={['1']}>
        <Menu.Item key="1">Trang chủ </Menu.Item>
        <Menu.Item key="2">Thông báo </Menu.Item>
        <Menu.Item key="3">Quy định</Menu.Item>
        <Menu.Item key="4">Sổ tay</Menu.Item>
        <Menu.Item key="5">Dịch vụ</Menu.Item>
        <Menu.Item key="">Liên hệ</Menu.Item>


      </Menu>

    </Header>

    </div>
  );
}

export default App;
